import { Platform } from 'react-native';
import envmon from './envmon';
import axios from 'axios';


let appVer = '0.9.0-alpha.ngrok';
let repoURL = 'https://github.com/furquan-lp/WebEnv';

const init = () => {
  console.log(axios.get(
    'https://api.jsonbin.io/b/6257c74280883c3054e15f27/0',
    {
      headers: {
        'X-Master-Key': '$2b$10$4.HdFvtRRxllCCbdGlpYUe5dOdu6WBmkiEc6BxuQhOlgcQPxZunlS'
      }
    }
  ));
}

const isWeb = () => {
  return (Platform.OS === 'web');
};

const getOS = () => {
  return Platform.OS;
};

const getAppVersion = () => {
  return appVer;
};

const getRepoURL = () => {
  return repoURL;
}

export default { init, isWeb, getOS, getAppVersion, getRepoURL };
